        public static async UniTask LoadItemsByShopIDAsync(int shopID)
        {
            #region loadedString

            var loadedString =
                @"[{'id':'1','name':'Куртка','size':'S, M, L','price':'1200','color':'черный','material':'канвас','sale':'false','type':'SHIRTS','shop':'1','image':'','shop_name':'Zolla','address':'ул. Революции, 60/1','site':'https://zolla.com/','latitude':'58.01099','longitude':'56.23601'},{'id':'1','name':'Футболка1','size':'S','price':'3600','color':'белый','material':'хлопок','sale':'false','type':'T_SHIRTS','shop':'1','image':'','shop_name':'Zolla','address':'ул. Революции, 60/1','site':'https://zolla.com/','latitude':'58.01099','longitude':'56.23601'},{'id':'1','name':'Футболка2','size':'M','price':'2560','color':'зеленый','material':'хлопок','sale':'false','type':'T_SHIRTS','shop':'1','image':'','shop_name':'Zolla','address':'ул. Революции, 60/1','site':'https://zolla.com/','latitude':'58.01099','longitude':'56.23601'}]";

            #endregion

            // todo: load data by shop id

            Products = JsonConvert.DeserializeObject<Product[]>(loadedString);

            foreach (var product in Products)
            {
                byte[] imageBytes = System.Convert.FromBase64String(product.Image);
                Texture2D tex = new Texture2D(1, 1);
                tex.LoadImage(imageBytes);

                Sprite sprite = Sprite.Create(tex, new Rect(0.0f, 0.0f, tex.width, tex.height), Vector2.one, 100.0f);

                product.Sprite = sprite;
            }
        }

        public static ShopData[] GetShopData()
        {
            return ShopDataCollection;
        }

        public static Product[] GetProducts()
        {
            return Products;
        }
